es.sum(dim=1, keepdim=True)  # shape: (N, 1)\n    \n    # Initialize Integrated Gradients.\n    ig = IntegratedGradients(forward_func)\n    \n    # Compute attributions with target=0 (selecting the first column)\n    attr, delta = ig.attribute(input_tensor, baseline, target=0, n_steps=n_steps, return_convergence_delta=True)\n    \n    # Process the attribution map:\n    # Remove the batch dimension, rearrange to (H, W, C), and aggregate channel attributions.\n    attr = attr.squeeze(0).detach().cpu().numpy().transpose(1, 2, 0)\n    heatmap = np.mean(np.abs(attr), axis=2)\n    # Normalize the heatmap.\n    heatmap = (heatmap - heatmap.min()) / (heatmap.max() - heatmap.min() + 1e-8)\n    # Resize the heatmap to the original image size.\n    heatmap = cv2.resize(heatmap, (image.size[0], image.size[1]))\n    \n    # Convert the original image to a NumPy array.\n    image_np = np.array(image)\n    # Apply a color map to the heatmap.\n    heatmap_color = cv2.applyColorMap(np.uint8(255 * heatmap), cv2.COLORMAP_JET)\n    heatmap_color = cv2.cvtColor(heatmap_color, cv2.COLOR_BGR2RGB)\n    # Create an overlay by blending the original image with the heatmap.\n    overlay = (0.5 * image_np + 0.5 * heatmap_color).astype(np.uint8)\n    \n    return overlay, heatmap\n\nif __name__ == \"__main__\":\n    # Load a test image (update the path as needed)\n    test_image_path = \"/kaggle/input/test-image/Q97453.jpg\"  # Replace with your test image file path\n    test_image = Image.open(test_image_path).convert(\"RGB\")\n    \n    # Generate XAI explanation using Integrated Gradients.\n    overlay, heatmap = explain_moco_ig(model, test_image, device, n_steps=50)\n    \n    # Display the original image and the overlay with heatmap side by side.\n    plt.figure(figsize=(12, 6))\n    \n    plt.subplot(1, 2, 1)\n    plt.imshow(test_image)\n    plt.title(\"Original Test Image\")\n    plt.axis(\"off\")\n    \n    plt.subplot(1, 2, 2)\n    plt.imshow(overlay)\n    plt.title(\"Integrated Gradients Overlay\")\n    plt.axis(\"off\")\n    \n    plt.suptitle(\"MoCo Model XAI Explanation\", fontsize=16)\n    plt.show()\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-03-14T07:30:28.359971Z","iopub.execute_input":"2025-03-14T07:30:28.360383Z","iopub.status.idle":"2025-03-14T07:30:30.270011Z","shell.execute_reply.started":"2025-03-14T07:30:28.360356Z","shell.execute_reply":"2025-03-14T07:30:30.268961Z"}},"outputs":[],"execution_count":null},{"cell_type":"code","source":"import os\nimport torch\nimport torch.nn as nn\nimport numpy as np\nimport matplotlib.pyplot as plt\nimport cv2\nfrom PIL import Image, ImageFilter\nfrom torchvision import transforms, models\nfrom captum.attr import IntegratedGradients\n\n# --------------------------\n# Define the MoCo Model\n# --------------------------\nclass MoCo(nn.Module):\n    def __init__(self, base_model, feature_dim=128, queue_size=65536, momentum=0.999, temperature=0.07):\n        super(MoCo, self).__init__()\n        self.encoder_q = base_model(num_classes=feature_dim)\n        self.encoder_k = base_model(num_classes=feature_dim)\n        self.temperature = temperature\n        self.momentum = momentum\n        self.register_buffer(\"queue\", torch.randn(feature_dim, queue_size))\n        self.queue = nn.functional.normalize(self.queue, dim=0)\n        self.register_buffer(\"queue_ptr\", torch.zeros(1, dtype=torch.long))\n        \n    def forward(self, x_q, x_k):\n        q = self.encoder_q(x_q)\n        q = nn.functional.normalize(q, dim=1)\n        with torch.no_grad():\n            k = self.encoder_k(x_k)\n            k = nn.functional.normalize(k, dim=1)\n        return q, k\n\n# --------------------------\n# Setup Device and Model\n# --------------------------\ndevice = torch.device(\"cuda\" if torch.cuda.is_available() else \"cpu\")\nprint(\"Using device:\", device)\n\n# Initialize MoCo model (using ResNet18 as backbone)\nmodel = MoCo(models.resnet18, feature_dim=128).to(device)\n\n# Load last checkpoint (update the path as needed)\ncheckpoint_path = \"/kaggle/input/moco-epoch-checkpoints/checkpoint_epoch_48.pth\"  # Update this path\nif os.path.exists(checkpoint_path):\n    checkpoint = torch.load(checkpoint_path, map_location=device)\n    model.load_state_dict(checkpoint[\"model_state_dict\"])\n    print(\"âœ… Loaded checkpoint from\", checkpoint_path)\nelse:\n    print(\"ðŸš© No checkpoint found. Using randomly initialized weights.\")\n\n# --------------------------\n# Helper: Create Baseline Tensor\n# --------------------------\ndef get_baseline_tensor(image, transform, baseline_type=\"black\"):\n    \"\"\"\n    Returns a tensor for the baseline/reference input.\n    \n    Args:\n        image (PIL.Image): The input image (used for size).\n        transform (callable): Transform to convert an image to a tensor.\n        baseline_type (str): One of 'black', 'white', 'blur', or 'mean'.\n    \n    Returns:\n        Tensor: Baseline image tensor with batch dimension.\n    \"\"\"\n    if baseline_type == \"black\":\n        baseline_image = Image.new(\"RGB\", image.size, (0, 0, 0))\n    elif baseline_type == \"white\":\n        baseline_image = Image.new(\"RGB\", image.size, (255, 255, 255))\n    elif baseline_type == \"blur\":\n        # A blurred version of the input image.\n        baseline_image = image.filter(ImageFilter.GaussianBlur(radius=10))\n    elif baseline_type == \"mean\":\n        # Approximate ImageNet mean in 0-255 range.\n        baseline_image = Image.new(\"RGB\", image.size, (123, 116, 103))\n    else:\n        raise ValueError(\"Unknown baseline_type. Choose from 'black', 'white', 'blur', or 'mean'.\")\n    \n    baseline_tensor = transform(baseline_image).unsqueeze(0)\n    return baseline_tensor\n\n# --------------------------\n# Integrated Gradients Explanation Function\n# --------------------------\ndef explain_moco_ig(moco_model, image, device, baseline=None, n_steps=50, baseline_type=\"black\"):\n    \"\"\"\n    Generates an attribution heatmap using Integrated Gradients for the MoCo model's encoder_q.\n    \n    Args:\n        moco_model (nn.Module): Trained MoCo model.\n        image (PIL.Image): Input test image.\n        device (torch.device): CPU or GPU.\n        baseline (Tensor, optional): Baseline tensor for IG. If None, a baseline is generated.\n        n_steps (int): Number of interpolation steps.\n        baseline_type (str): Baseline type to use if no baseline is provided.\n        \n    Returns:\n        overlay (np.array): The original image blended with the attribution heatmap.\n        heatmap (np.array): The normalized attribution heatmap.\n    \"\"\"\n    moco_model.eval()\n    \n    # Define transform matching training preprocessing.\n    test_transform = transforms.Compose([\n        transforms.Resize((224, 224)),\n        transforms.ToTensor(),\n        transforms.Normalize(mean=[0.485, 0.456, 0.406],\n                             std=[0.229, 0.224, 0.225])\n    ])\n    \n    # Preprocess input image.\n    input_tensor = test_transform(image).unsqueeze(0).to(device)\n    if baseline is None:\n        baseline = get_baseline_tensor(image, test_transform, baseline_type=baseline_type).to(device)\n    \n    # Define forward function that outputs (N, 1) by summing encoder_q's features.\n    def forward_func(x):\n        features = moco_model.encoder_q(x)  # shape: (N, feature_dim)\n        return features.sum(dim=1, keepdim=True)  # shape: (N, 1)\n    \n    ig = IntegratedGradients(forward_func)\n    # Compute attributions with target=0 (selecting the single output column).\n    attr, delta = ig.attribute(input_tensor, baseline, target=0, n_steps=n_steps, return_convergence_delta=True)\n    \n    # Process attributions: remove batch dim, rearrange to (H, W, C), then average over channels.\n    attr = attr.squeeze(0).detach().cpu().numpy().transpose(1, 2, 0)\n    heatmap = np.mean(np.abs(attr), axis=2)\n    heatmap = (heatmap - heatmap.min()) / (heatmap.max() - heatmap.min(